INSERT INTO `phpbb_posts` VALUES (14,14,105,54,0,'82.159.104.78',1353443837,1,0,1,1,1,1,'','Contador: &quot;El recorrido del Giro se ajusta bastante a mí&quot;','Es lo que ha declarado el ciclista de Pinto. Sin tener clarificadas aún las grandes etapas en las que correrá, Alberto Contador admite que no descarta ninguna opción:\n\n&quot;El Giro tiene un recorrido que se ajusta bastante bien a mí. No voy a descartar ninguna de las tres grandes hasta analizar el recorrido de todas. Con el Giro y la Vuelta tan separados en el tiempo, decantarse por las dos es la opción más sencilla. Ya lo hice en 2008&quot;\n\nPuede verse la entrevista entera en el siguiente enlace:\n\n<!-- m --><a class=\"postlink\" href=\"http://www.cyclingnews.com/features/alberto-contador-exclusive-my-only-intention-is-to-win\">http://www.cyclingnews.com/features/alb ... -is-to-win</a><!-- m -->','8ce6bf7ce6c07cdef1aba1487ac3ee2f',0,'','1yu09pdw',1,0,'',0,0,0),(12,12,104,54,0,'82.159.104.78',1353442172,1,0,1,1,1,1,'','Hola a todos los usuarios del foro','Me presento.\n\nMe llamo Sergio.\n\nCiudad: Pinto (Madrid)\nBicicleta: Rockrider 2012 8.2 (MTB)\n\nUn saludo.','2ada4c6e0eb5b168c452681ed3e6a7cd',0,'','1fte5wpd',1,0,'',0,0,0),(15,15,32,55,0,'82.159.104.78',1353454743,1,0,1,1,1,1,'','Normas del foro','Al ingresar en &quot;foro.buscobici.com&quot; (de aquí en adelante &quot;nosotros&quot;, &quot;nos&quot;, &quot;nuestro&quot;, &quot;foro.buscobici.com&quot;, &quot;http://www.buscobici.com/forum&quot;), acuerda estar legalmente sometido a los siguientes términos. En caso contrario por favor no se registre y/o use &quot;foro.buscobici.com&quot;. Podemos cambiar estos términos en cualquier momento e intentaríamos avisarle, sin embargo sería prudente que los revisase por su cuenta periódicamente. Seguir registrado a &quot;foro.buscobici.com&quot; después de esos cambios significa que acuerda estar legalmente sometido a esos nuevos términos tal como fueron actualizados y/o reformados.\n\nNuestros foros están desarrollados por phpBB (de aquí en adelante &quot;ellos&quot;, &quot;sus&quot;, &quot;software phpBB&quot;, &quot;www.phpbb.com&quot;, &quot;phpBB Group&quot;, &quot;phpBB Teams&quot;) el cual es una solución liberada bajo la &quot;Licencia Pública General (General Public License en inglés)&quot; (de aquí en adelante &quot;GPL&quot;) y puede ser descargada de <!-- m --><a class=\"postlink\" href=\"http://www.phpbb.com\">http://www.phpbb.com</a><!-- m -->. \nEl software phpBB solamente facilita discusiones basadas en Internet y la GPL estrictamente los excluye de lo que aprobamos y/o desaprobamos como conductas y/o contenido permisible. Para más información sobre phpBB, por favor visite: <!-- m --><a class=\"postlink\" href=\"http://www.phpbb.com/\">http://www.phpbb.com/</a><!-- m -->.\n\nAcuerda no enviar ningun contenido abusivo, obsceno, vulgar, difamatorio, indecente, amenazante, sexual o cualquier otro material que pueda violar cualquier ley de su país, el país donde &quot;foro.buscobici.com&quot; está instalado o Leyes Internacionales. Hacer eso provocará que sea inmediata y permanentemente expulsado y, si lo creemos oportuno, con notificación a su Proveedor de Servicios de Internet. Las direcciones IP de todos los envíos son registradas como ayuda para reforzar estas condiciones. Acuerda que &quot;foro.buscobici.com&quot; tiene derecho a eliminar, editar, mover o cerrar cualquier tema en cualquier momento que lo creamos conveniente. Como usuario acuerda que cualquier información que haya ingresado será almacenada en una base de datos. Dado que esta información no será compartida con ninguna tercera parte sin su consentimiento, ni &quot;foro.buscobici.com&quot; ni phpBB podrán considerarse responsables por cualquier intento de hacking que conlleve a que los datos sean comprometidos.','f9818a4248addfdbc98da72aea94eb44',0,'','30cz0vgo',1,0,'',0,0,0),(16,16,105,55,0,'82.159.104.78',1353621066,1,0,1,1,1,1,'','Mark Cavendish: &quot;Estoy relativamente bien&quot;','Mark Cavendish ha declarado que está &quot;relativamente bien&quot; tras sufrir una colisión con un coche mientras entrenaba en Italia.\n\nCavendish, ganador del Mundial de Ciclismo en Carretera en el año 2011, y con residencia en Italia, comentó el lunes a sus seguidores de Twitter lo siguiente:\n\n&quot;Me estampé contra la parte trasera de un coche que se frenó de golpe mientras estaba entrenando. No fue un buen día. Aparte de un brazo magullado, estoy relativamente bien. Por si a alguien le interesa.&quot;\n\nMark Cavendish has said he is “relatively ok” after colliding with a car while training in Italy.\n\nCavendish, the 2011 world road race champion, who has a home in Tuscany, told his Twitter followers on Monday: “Went &amp; hit the back of a car that slammed on today in training. Wasn’t ideal. Apart from a bruised arm, I’m relatively ok. If anyone cares.”','b6deb06075d4006983d90f60cd8c5f21',0,'','3owy2oqc',1,0,'',0,0,0),(17,17,36,58,0,'79.146.22.177',1353660263,1,0,1,1,1,1,'','Bielas XTR','Bielas XTR a 350€ quedan sólo 2\n\n<!-- m --><a class=\"postlink\" href=\"http://www.ciclosnico.com/tienda/product.php?id_product=25\">http://www.ciclosnico.com/tienda/produc ... product=25</a><!-- m -->','05cfbe340db70733a94f5b175acd18c9',0,'','6i8qpp6m',1,0,'',0,0,0),(18,18,13,58,0,'79.146.22.177',1353661712,1,0,1,1,1,1,'','Ciclos Nico','Muy buenas,\nCiclos Nico tienda especializada en ciclismo desde 1956 (ayer) por fin tiene su web.\nRecomendamos que preguntéis precio, sobre todo de bicis del año actual, en este caso 2013 las del 2012 ya están rebajadas.\n\nSi necesitáis algún producto de nuestras marcas, y no lo veis en la web, no dudéis en poneros en contacto con nosotros como por ejemplo Shimano, ya que intentamos poner los productos que tenemos en tienda física para dar mejor servicio en los envíos.\n\n<!-- m --><a class=\"postlink\" href=\"http://www.ciclosnico.com/tienda/\">http://www.ciclosnico.com/tienda/</a><!-- m -->\n\nUn saludo','a47ccb8de5f743487f26812a3ff5016e',0,'','2wmwgpji',1,0,'',0,0,0),(19,19,27,59,0,'62.42.5.67',1353688977,1,0,1,1,1,1,'','DominguerosMTB Cantabria','Somos un grupo de amantes de la bici de montaña que nos unimos los domingos por la mañana para realizar una ruta desde algun punto de nuestra región.\n\nNuestras obligaciones familiares o nuestra disponibilidad nos hs hecho un hueco solo este día, de forma que lo aprovechamos al máximo, quedando en nuestro foro para la siguiente ruta todos aquellos domingueros o todo aquel que quiera venir con nosotros.\n\nUn cordial saludo.\n\nFran\nAdministrador\n\ndominguerosmtb.foroactivo.com','41c68706f1e10c6d8c0c763ba326d9a2',0,'','2ejhpnoo',1,0,'',0,0,0),(24,22,104,55,0,'82.159.104.78',1353845116,1,0,1,1,1,1,'','Re: presentacion','Hola. Bienvenido al foro.\n\nNo eres la primera persona que hace una petición del estilo.\n\n¿Qué te parece incluir un foro &quot;Pintura / Restauración&quot; en cada una de las categorías (MTB, Carretera, etc.)?\n\nUn saludo','0a21945159fb048dd69067d26b6faaeb',0,'','1kzessgb',1,0,'',0,0,0),(25,23,85,55,0,'82.159.104.78',1353854751,1,0,1,1,1,1,'','buscobici.com - Actualización de Base de Datos','Hola.\n\nSe ha actualizado la base de datos de [url:1wga8bag]http&#58;//www&#46;buscobici&#46;com[/url:1wga8bag] para recoger las actualizaciones de las tiendas.\n\nUn saludo','e6b31e6deea3f21c9932a8451b015952',0,'EA==','1wga8bag',1,0,'',0,0,0),(23,22,104,60,0,'81.36.33.170',1353833100,1,0,1,1,1,1,'','presentacion','hola a todos,soy de valencia,propietario de una lapierre x-control 210 y uno de mis tantos hobbys es pintar bicis,me gustaria me aconsejarais en que seccion seria mejor poner un post donde dar consejos de pintura y al mismo tiempo colgar mis trabajos para que se me conozca un poco mas.\nalgunos ya me conoceran por el foro mtb donde ya tengo un post,pero viendo como esta el tema en el foro mtb no se lo que durara.\nsaludos.','379519ad1dadb26c3a95ab086bbc1aca',0,'','1ymn1xz8',1,0,'',0,0,0),(26,24,105,55,0,'82.159.104.78',1353857218,1,0,1,1,1,1,'','Juan José Lobato: feliz tras su fichaje por el Euskaltel','Juan José Lobato ficha por Euskaltel-Euskadi para la temporada 2013. El ciclista gaditano ha declarado: &quot;Estoy feliz tras fichar por un equipo de \'Liga de Campeones\'&quot;\n\n<!-- m --><a class=\"postlink\" href=\"http://www.esciclismo.com/ampliada.asp?Id=24053\">http://www.esciclismo.com/ampliada.asp?Id=24053</a><!-- m -->','bc802585fa090f577449c6a96910bc84',0,'','230pt7py',1,0,'',0,0,0),(27,25,20,61,0,'82.159.104.78',1353857695,1,0,1,1,1,1,'','Compra MTB-Rígida, presupuesto: 1000 euros','Hola.\n\nMe gustaría comprar una MTB rígida. Mi presupuesto es de en torno a 1000 euros.\n\n¿Qué me recomendáis? ¿Conocéis alguna oferta que merezca realemente la pena?\n\nUn saludo.','c0a89e321cc668f6290c0654c7042a72',0,'','2d726n0x',1,0,'',0,0,0),(28,25,20,55,0,'82.159.104.78',1353858745,1,0,1,1,1,1,'','Re: Compra MTB-Rígida, presupuesto: 1000 euros','Hola. Para mí, por ese precio la mejor es la Trek 6700. La tienes en Bicimania por 1039 euros:\n\n[url:2kjpxu1k]http&#58;//bicimania&#46;com/trek-6700-disc-2012-p-6228&#46;html[/url:2kjpxu1k]\n\nRock Shox Reba, Cambio Deore XT y Bielas XT. Precio imbatible, sinceramente.\n\nDe todas formas, te dejo un listado con más modelos, obentidos a través de [url:2kjpxu1k]http&#58;//www&#46;buscobici&#46;com[/url:2kjpxu1k]:\n\n[url:2kjpxu1k]http&#58;//www&#46;mammoth&#46;es/producto/bicicletas/specialized/rockhopper-pro-2012[/url:2kjpxu1k]\n[url:2kjpxu1k]http&#58;//www&#46;chainreactioncycles&#46;com/Models&#46;aspx?ModelID=81012[/url:2kjpxu1k]\n[url:2kjpxu1k]http&#58;//www&#46;chainreactioncycles&#46;com/Models&#46;aspx?ModelID=83492[/url:2kjpxu1k]\n[url:2kjpxu1k]http&#58;//www&#46;bikeos&#46;com/index&#46;php/bicicletas/mountain-bike/bicicleta-monta-a-scott-scale-50-2012&#46;html[/url:2kjpxu1k]\n[url:2kjpxu1k]http&#58;//www&#46;bicispasaje&#46;es/orbea-2013/orbea-alma-29er-h60&#46;html[/url:2kjpxu1k]\n[url:2kjpxu1k]http&#58;//www&#46;bicispasaje&#46;es/or