'kA==','3eokegx4',1,0,'',0,0,0),(30,25,20,59,0,'62.42.5.67',1353865502,1,0,1,1,1,1,'','Re: Compra MTB-Rígida, presupuesto: 1000 euros','Pues con 1000 euros me compraría una de gama superior de segunda mano, que las venden como nuevas los caprichosos con dinero. <!-- s:D --><img src=\"{SMILIES_PATH}/icon_e_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D -->\n\nUn ejemplo solamente:\n\n<!-- m --><a class=\"postlink\" href=\"http://www.foromtb.com/showthread.php/943488-Vendo-scott-scale-30-carbono-900-euros-talla-L\">http://www.foromtb.com/showthread.php/9 ... os-talla-L</a><!-- m -->','3edcd1d3ada3bfa628ac8de92e6bd66c',0,'','ukz1dz7t',1,0,'',0,0,0),(31,22,104,60,0,'81.36.33.170',1353868066,1,0,1,1,1,1,'','Re: presentacion','estaria bien pero un poco complicado tener que estar mirando cada una de las secciones,sereia mejor un solo post para todos, no?,y que la gente exponga sus dudas,ademas habria que explicar las tipicas preguntas en cada uno de los post y de la otra forma queda todo aclarado en uno solo.','f5221a1f356788e2ad616214560c359e',0,'','21wi4ph2',1,0,'',0,0,0),(32,25,20,60,0,'81.36.33.170',1353868291,1,0,1,1,1,1,'','Re: Compra MTB-Rígida, presupuesto: 1000 euros','yo tambien buscaria algo de segunda mano de gama mas alta,las hay en muy buen estado.','d238a68702a0dcc6f54ce7cc7aa509fe',0,'','hm721m05',1,0,'',0,0,0),(33,26,13,60,0,'81.36.33.170',1353868919,1,0,1,1,1,1,'','AEROTEC,bicis personalizadas','taller de pintura especializado en bicis y motos.\npresupuesto sin compromiso.\n[url:s99t2ad4]http&#58;//aerotecg&#46;blogspot&#46;com&#46;es/[/url:s99t2ad4]','87e3d56a5debf22dc55794fdfee9bdee',0,'EA==','s99t2ad4',1,0,'',0,0,0),(34,22,104,55,0,'82.159.104.78',1353962731,1,0,1,1,1,1,'','Re: presentacion','Entonces, ¿recomiendas una única categoría de restauración / pintura ? \n\nRealmente ... ¿ es lo mismo restaurar una bicicleta MTB, que una de Carretera, que una Fixie ?\n\nYo no estoy tan seguro. \n\nAdemás, de ser así, habría que cambiar toda la estructura del foro (ojo, no me estoy negando, simplemente analizando pros y contras de lo que podría suponer tu propuesta).\n\nSegún tu propuesta, ¿qué estructura pasaría a tener el foro entonces? \nUna única categoría, de tipo &quot;bicicletas&quot;, por ejemplo, en la que cuelgan modalidades (MTB, Road, etc), mecánica, bicicletas, componentes, etc.etc.\n\nNo acabo de verlo claro.\n\nComéntame tus opiniones.','0c276b32a69e37e44ae453fae9358d7f',0,'','2ytp4je4',1,0,'',0,0,0),(35,22,104,60,0,'81.36.33.170',1354050849,1,0,1,1,1,1,'','Re: presentacion','yo lo pondria en seccion mecanica el problema esque tambien teneis una mecanica para cada bici,a la hora de pintar el proceso es el mismo ya sea mtb,carretera,bmx etc...\ndecapado,lijado,imprimacion,color,logos y lacado.\nno se exactamente donde lo ubicaria.\nsi quereis lo ponemos como vosotros habeis comentado,yo ire respondiendo en la medida de lo posible.','30606ab6266f8b08ab5072a2fe642da1',0,'','28a2dr5i',1,0,'',0,0,0),(36,27,20,62,0,'83.41.5.51',1354480550,1,0,1,1,1,1,'','Para empezar','[color=#0040BF:27h97un7]Buenas tardes a todos.\nLlevo dos años practicando spinnig para bajar peso y ahora he decidido comprarme una de montaña para hacer un poco de ruteo.\n\nHe sondeado el mercado de segunda mano y he recoletado un par de ofertas para que me aconsejeis.\n\nMuchas gracias a todos por vuestro interes.\n\nLa ofertas son:\n\nBH LIBERTY SEGUROS LX, DISCO (300€)\nCuadro de aluminio de alta resistencia, frenos hidraulicos con discos y manetas formula oro, horquilla con bloqueo en el manillar, cambios shimano LX. Tiene cuentakilometros y luces trasera y delantera. Ruedas mavic disc con cubiertas maxxis nuevas. Costo 790 hace dos años. (Segun informa el vendedor)\n\nGT AVALANCHE 3. 0 (150€)\nse vende gt avalanche 3. 0 en perfecto estado, llantas 26 pulgadas, cuadro talla M, para personas de 1, 70 a 1, 80 mas o menos.\n\nBICICLETA DE MONTAñA GT 2010 (350€)\nGT autpost año 2010 seminueva la vendo por no cojerla orquilla es rock shock 100mm de rrecorrido montada entera en shimano deore esta bici nueva ronda unos 600 euros\n\nBICICLETA GT , AVALANCHE 1, 0 TALLA M (260€)\nVendo bicicleta GT Avalanche 1. 0 en málaga capital, pintada en tricapa solo hace un mes por un taller y bien echo. . Ruedas Mavis con discos XT y neumáticos continental Race para carretera y frenos hidrauliscos shimano, esta nueva, pinte el cuadro por un capricho pero esta preciosa.\n\n\nEn fin, soy de Málaga  y espero vuestros consejos, también a la hora de ir a probarla.\nEn principio, me he fijado el tope en 300€\n\nSaludos y muchas muchas gracias. <!-- s:D --><img src=\"{SMILIES_PATH}/icon_e_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D -->  <!-- s:D --><img src=\"{SMILIES_PATH}/icon_e_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D -->  <!-- s:D --><img src=\"{SMILIES_PATH}/icon_e_biggrin.gif\" alt=\":D\" title=\"Very Happy\" /><!-- s:D --> \n[color=#0040BF][/color:27h97un7][/color]','278188607076f465599d405e54bb2f64',0,'Ag==','27h97un7',1,0,'',0,0,0),(37,27,20,61,0,'82.159.104.78',1354626218,1,0,1,1,1,1,'','Re: Para empezar','Buenas. \n\nComo recomendación general, comentarte que [b:zadeatu2]lo mejor es que te sientas cómodo sobre la bici[/b:zadeatu2]. \n\nLuego, fíjate también en las sensaciones a la hora de bajar y de frenar, puesto que así probarás básicamente tanto la horquilla como los frenos.\n\nCon la información que has subido, no puedo darte una opinión cerrada, ya que falta información para todos los modelos. \n\nObviamente, elegiría entre la BH y la GT (ambas en torno a 300 euros, si no me equivoco). En concreto, la BH, es suficiente para empezar (cambio SLX, horquilla con bloqueo en manillar, frenos hidraúlicos).\n\nUn saludo','5e9d91d865a634ccfa08364ce382111d',0,'QA==','zadeatu2',1,0,'',0,0,0),(38,23,85,55,0,'82.159.104.78',1354818522,1,0,1,1,1,1,'','Re: buscobici.com - Actualización de Base de Datos','Se añade la colección de bicicletas de BiciEscapa ([url:mj13w9ho]http&#58;//www&#46;biciescapa&#46;com/[/url:mj13w9ho]) a la base de datos de [url:mj13w9ho]http&#58;//www&#46;buscobici&#46;com/[/url:mj13w9ho]\n\nCon esta, son ya 16 tiendas adheridas a la página:\n\nBicicletas Gil\nBicicletas Pasaje\nBicimania\nBicimarket\nBiciEscapa\nBikeOS\nBikeStocks\nBuhoBike\nCalmera\nChain Reaction\nCiclos Nico\nMammoth\nProbike\nProbikeShop\nSanferbike\nTomasDomingo\n\nEsperemos que os ayude en la difícil tarea de la búsqueda de vuestra bici soñada.\n\nUn saludo.','4d12fd0f9c01ec94b06e30eecc4ee518',0,'EA==','mj13w9ho',1,0,'',0,0,0),(39,28,21,61,0,'82.159.104.78',1354878661,1,0,1,1,1,1,'','Rockrider 8.2 2012 - Recomendación venta de segunda mano','Hola. Quiero vender una RockRider 8.1 del año 2012. La compré en verano. Está como nueva. \n\n    [b:pbizwohm]Cuadro[/b:pbizwohm]: aluminio 6061 T6 doble grosor; geometría racing; 1,850 kg en la talla M.Resistente y ligera. Su geometría ofrece la relación ideal escalada / descenso.\n\n    [b:pbizwohm]Horquilla[/b:pbizwohm] / Suspensión Nueva horquilla Rock Shox RECON Silver TK 100 mm Remote Lock-Out en el manillar. Ajuste eficaz del rebote y bloqueo con solo medio giro de palanca.\n\n    [b:pbizwohm]Transmisión[/b:pbizwohm] Desviador SRAM X - 7\n    [b:pbizwohm]Cambio[/b:pbizwohm] SRAM X - 7;\n    [b:pbizwohm]Palancas[/b:pbizwohm] tipo Push pull Sram X7.\n\n    [b:pbizwohm]Pedalier / Casete[/b:pbizwohm] Pedalier Shimano Deore M590 22x32x44\n    [b:pbizwohm]casete[/b:pbizwohm] SRAM PG950 11x32 9 velocidades\n\n    [b:pbizwohm]Frenos[/b:pbizwohm] Frenos de disco hidráulicos Avid ELIXIR 3, rotores de 160 mm; Potencia y progresividad en cualquier circunstancia\n\n    [b:pbizwohm]Manillar/Potencia/Dirección[/b:pbizwohm] Manillar elevado Rockrider Comp 600/ 640mm; potencia Rockrider Comp. Manillar y potencia oversize, más resistente y más ligera. La posición más elevada mejora el control y la comodidad sin pérdida de rendimiento.\n\n    [b:pbizwohm]Ruedas[/b:pbizwohm] Llantas Rockrider Comp 32 radios by Rigida. Bujes JT D041/D142, radios de acero inoxidable 2 mm. Rodamientos estancos.\n\n    [b:pbizwohm]Sillín/Tija[/b:pbizwohm] de sillín Nuevo sillín Rockrider MTB comp by vélo; Tija de sillín Rockrider\n\n    [b:pbizwohm]Pedales[/b:pbizwohm] Pedales automáticos Wellgo 823 WPD.\n\n¿Por cuánto la venderíais? \n\nUn saludo.','c4a09ec3effa6f2671d8942a548863f8',0,'QA==','pbizwohm',1,0,'',0,0,0),(40,29,105,61,0,'82.159.104.78',1354880541,1,0,1,1,1,1,'','Wiggins: Mejor deportista británico del año','[b:2z5zzjlc]Wiggins, ganador del Tour de Francia y campeón olímpico de Contrarreloj en Londres 2012, ha sido declarado el mejor deportista británico del año[/b:2z5zzjlc].\n\nSe ha impuesto al mediofondista [b:2z5zzjlc]Mo Farah[/b:2z5zzjlc] y al ganador del US Open [b:2z5zzjlc]Andy Murray[/b:2z5zzjlc].\n\nMás información:\n[url:2z5zzjlc]http&#58;//www&#46;elconfidencial&#46;com/deportes/2012/12/07/wiggins-mejor-deportista-britanico-del-ano-110737/[/url:2z5zzjlc]','e6c84305ae3942728c0aed6fcc2a9720',0,'UA==','2z5zzjlc',1,0,'',0,0,0),(41,30,23,61,0,'82.159.104.78',1354884766,1,0,1,1,1,1,'','Compro bicicleta Giant xtc 1 composite 2012','Hola.\n\nEstoy interesado en comprar la Giant xtc1 del año 2012. Pagaría hasta 1500 euros (depende un poco del estado en el que esté).\n\nUn saludo','489a35e9b899a127c1075076d89a90ec',0,'','3jmp145l',1,0,'',0,0,0),(44,33,97,60,0,'95.123.198.99',1354906439,1,0,1,1,1,1,'','PINTAR-PERSONALIZAR BICI','Hola a todos,me llamo teo y soy de valencia,en mis ratos libres me dedico a la aerografia y desde hace dos años especialmente a pintar bicis,desde aqui os animo a que si teneis cualquier duda en como hacerlo preguntar y contestare encantado,tambien si no os atreveis vosotros mismos os puedo pasar precio por mp.\nOs dejo algunas fotos de algunos modelos que he pintado,en mi blog podeis ver  muchos mas.\n[img:10faz671]http&#58;//4&#46;bp&#46;blogspot&#46;com/-FK2cEvXBSCo/ULpVmav1p5I/AAAAAAAABFU/J3W5Ab0b_JI/s1600/2012-11-28+18&#46;20&#46;47&#46;jpg[/img:10faz671]\n[img:10faz671]h