0% RALLY! POR 500€ MAS***[/b:2wk44f29]\n\nHola, pongo a la venta mi Scott Spark RC 2009, talla M, comprada en febrero de 2010, pero el cuadro es nuevo del mes de marzo del 2011 (garantía una fisurillas muy pequeñas, y tuve suerte). El basculante es el mismo, es decir, no me lo cambiaron.\n\nAlgunas rascadas de uso (en el vasculante, aunque tengo protectores &quot;muy buenos&quot; puestos ahora, pero ningún golpe o rascada muy grande en el cuadro.\n\nCompre el cuadro y lo monte con lo que tenia... al gusto. Este cuadro nuevo valia [b:2wk44f29]3000€[/b:2wk44f29] y pesa [b:2wk44f29]1,799gr[/b:2wk44f29] [b:2wk44f29](amortiguador incluido[/b:2wk44f29]) de los mas ligeros del mercado.\n\nLa [b:2wk44f29]tija [/b:2wk44f29]esta [b:2wk44f29]cortada a &quot;ras&quot; a 70cm[/b:2wk44f29] (centro eje pedalier a sillin), se puede subir hasta 74cm [b:2wk44f29]yo mido 1,68m[/b:2wk44f29], Hay un margen de [b:2wk44f29]4cm para subir el sillin[/b:2wk44f29] con el margen que tenemos con la mini tija Ritchey!\n[b:2wk44f29]\nComponentes:[/b:2wk44f29]\n\n[b:2wk44f29]Cuadro[/b:2wk44f29]:           Scott Spark RC 2009 (talla M) &quot;tija integrada&quot; cortada a 70cm.\n[b:2wk44f29]Horquilla[/b:2wk44f29]:         FOX F120 RLC 2009 (recien revisada, retenes y aceite)\n[b:2wk44f29]Manillar[/b:2wk44f29]:          Ritchey Superlogic Carbon \n[b:2wk44f29]Potencia[/b:2wk44f29]:         Ritchey WCS 4axis 90mm &quot;blanca&quot;\n[b:2wk44f29]Frenos[/b:2wk44f29]:            Shimano XT\n[b:2wk44f29]Cambio[/b:2wk44f29]:            Sram XO &quot;plata&quot; el normal (no el que sale en la foto, que es dorado)\n[b:2wk44f29]Mandos[/b:2wk44f29]:            Sram XO Giratorios\n[b:2wk44f29]Desviador[/b:2wk44f29]:        Shimano XT\n[b:2wk44f29]Bielas[/b:2wk44f29]:               Shimano SLX\n[b:2wk44f29]Sillin[/b:2wk44f29]:                 Ritchey WCS 130mm\n[b:2wk44f29]Puños[/b:2wk44f29]:              Bontrager &quot;espuma&quot;\n[b:2wk44f29]Portabidones[/b:2wk44f29]:   Scott Comp &quot;Nylon&quot; Negro/