ontacto vale?\nUn saludo...','ad1a9ab6714cc0b3a4a6cf9cc27d07e8',0,'','2m2rey4f',1,0,'',0,0,0),(1869,1772,23,186,0,'2.136.191.158',1355764764,1,0,1,1,1,1,'','Re: Frenos formula rx','Hola Sorento, yo tenia unos Rx y los cambie porque dan problemas, si tienes los shimano slx no te recomiendo que los cambies por los formula, los slx funcionan mejor que los Rx.','13c191f94710495468ac9091afbfb0d5',0,'','3121ymdq',1,0,'',0,0,0),(1870,25,20,186,0,'2.136.191.158',1355765867,1,0,1,1,1,1,'','Re: Compra MTB-Rígida, presupuesto: 1000 euros','Hola tienes tambien esta:\n<!-- m --><a class=\"postlink\" href=\"http://www.canyon.com/_es/mountainbikes/bike.html?b=3008#tab-reiter2\">http://www.canyon.com/_es/mountainbikes ... ab-reiter2</a><!-- m -->\nLa pega que la compras por internet, de todas las que te han puesto hay yo cogeria la trek, segundamano lo descarto.','b316c43754011fcc6c71ab5e1a60be83',0,'','pvvcw35q',1,0,'',0,0,0),(1871,28,21,186,0,'2.136.191.158',1355766213,1,0,1,1,1,1,'','Re: Rockrider 8.2 2012 - Recomendación venta de segunda mano','Hola creo que mas de 500-600 euros no te van a dar por ella.','d388339b2fadce5f9a74d7241d92f702',0,'','1d52jp23',1,0,'',0,0,0);
