INSERT INTO `phpbb_privmsgs` VALUES (1,0,2,0,'82.159.104.78',1353196260,1,1,1,1,'Bienvenido al foro !','Hola! Bienvenido al foro de buscobici.com\n\nEsperamos poder ayudarte en todas tus dudas.\n\nUn saludo !!!','',0,0,'','3ltgex0m',0,0,'u_54','',0),(2,0,2,0,'82.159.104.78',1353234613,1,1,1,1,'Hola !','Hola !','',0,0,'','1rb1vkfl',0,0,'u_55','',0),(3,0,54,0,'82.159.104.78',1353448439,1,1,1,1,'Prueba de mensaje','Hola Ricky. Esto es una prueba de un mensaje privado.\n\nUn saludo !!!','',0,0,'','u51r8i0z',0,0,'u_56','',0),(4,0,59,0,'62.42.5.67',1353690496,1,1,1,1,'Re: Normas del foro','Buenas!! Me confundí al crear un tema, me lo puedes mover de Webs a Foros??\n\nSoy Fran, administrador de dominguerosmtb.\n\nGracias y un saludo','',0,0,'','1tv2mhjx',0,0,'u_55','',0),(5,4,55,0,'82.159.104.78',1353845314,1,1,1,1,'Re: Normas del foro','Hola Fran.\n\nYa lo tienes movido. \n\nGracias y bienvenido !','',0,0,'','2t3gpglq',0,0,'u_59','',0),(6,0,55,0,'82.159.104.78',1353847809,1,1,1,1,'Ya lo tienes','Hola. Bienvenido al foro.\n\nYa te he movido tu post al hilo de &quot;Foros&quot;.\n\nUn saludo y gracias por visitar [url:1vytsv22]http&#58;//foro&#46;buscobici&#46;com[/url:1vytsv22] !','',0,0,'EA==','1vytsv22',1353847831,1,'u_59','',0),(7,0,55,0,'82.159.104.78',1354878309,1,1,1,1,'Categoría: Pintura y Rest','Hola aerotec.\n\nAl final, he modificado la estructura del foro, para que exista una categoría única (&quot;Mundo Bici&quot;) y dentro de ellas las categorías más comunes (Bicicletas, Mecánica, [b:r46euj72]Restauración y Pintura[/b:r46euj72], etc.).\n\nPuedes utilizar la que te interese para tu tienda de la forma que creas conveniente.\n\nUn saludo','',0,0,'QA==','r46euj72',0,0,'u_60','',0),(8,7,60,0,'95.123.198.99',1354905985,1,1,1,1,'Re: Categoría: Pintura y Rest','ok,gracias,voy a ver donde lo pongo,\nsaludos','',0,0,'','1ki1hhs1',0,0,'u_55','',0),(9,0,55,0,'82.159.104.78',1355090466,1,1,1,1,'Bienvenido,  Angel !','Desde <!-- w --><a class=\"postlink\" href=\"http://www.buscobici.com\">www.buscobici.com</a><!-- w -->, decirte que estamos encantados de que te unas al foro.\n\nUn saludo !','',0,0,'','18h1gnsg',0,0,'u_70','',0),(10,0,55,0,'82.159.104.78',1355267267,1,1,1,1,'Sugerencia recibida','Hola Dani.\n\nGracias por la sugerencia sobre Venta en 2ª mano.\n\n¿Como sugieres hacer la división? ¿Por categorías y subcategorías?\n\nMe expico:\n\nBicicletas\n|-- MTB\n|-- Carretera\n... etc.\n\nComponentes\n|-- Horquillas\n|-- Bielas\n... etc.\n\nUn saludo','',0,0,'','2rsvrpvf',0,0,'u_81','',0),(11,0,55,0,'82.159.104.78',1355347137,1,1,1,1,'Anuncios de venta','Hola.\n\nPor favor, publica tus anuncios de venta en el sitio específico, el hilo de venta de 2ª mano.\n\nUn saludo.','',0,0,'','2krn79ox',0,0,'u_100','',0),(12,11,100,0,'83.41.12.82',1355381114,1,1,1,1,'Re: Anuncios de venta','hola asi lo hare pues retirame los que tengo,,,,,y lo siento','',0,0,'','2tu5a5wq',0,0,'u_55','',0),(13,11,100,0,'83.41.12.82',1355381394,1,1,1,1,'Re: Anuncios de venta','[quote=&quot;buscobici.com&quot;:1limt4ad]Hola.\n\nPor favor, publica tus anuncios de venta en el sitio específico, el hilo de venta de 2ª mano.\n\nUn saludo.[/quote:1limt4ad]\n\nhola buenos dias,muchas gracias por movermelos al sitio correspondiente,,,te lo agradezco.......ya no volvera a pasar\n\nun saludo y feliz navidad','',0,0,'gA==','1limt4ad',0,0,'u_55','',0),(14,11,55,0,'82.159.104.78',1355436907,1,1,1,1,'Re: Anuncios de venta','No pasa nada. \n\nEra simplemente una sugerencia, para intentar mantener los hilos del foro de la forma más ordenada posible.\n\nUn saludo y bienvenido al foro !','',0,0,'','omv54d6v',0,0,'u_100','',0),(15,0,55,0,'62.83.92.220',1355655651,1,1,1,1,'Hilo de venta','Hola. Te he movido el anuncio a la categoría de 2ª mano - Venta de Componentes.\n\nPor favor, de ahora en adelante intenta postear en dicha categoría todo lo que tenga que ver con venta, para tener el foro lo más ordenado posible.\n\nGracias y un saludo !','',0,0,'','1pxa5508',0,0,'u_212','',0),(16,0,101,0,'88.12.95.119',1355684119,1,1,1,1,'Re: vendo garmin edge 305','[url=http&#58;//www&#46;buscobici&#46;com/forum/viewtopic&#46;php?p=1790#p1790:i3wvam62]Asunto: vendo garmin edge 305[/url:i3wvam62]\n\n[quote=&quot;horko44&quot;:i3wvam62]hola vendo mi garmin 305, lo vendo por cambio a uno superior, esta nuevo. impoluto, \n\nprecio 130€[/quote:i3wvam62]\n\n\nte interesaria un oregon 550?','',0,0,'kA==','i3wvam62',0,0,'u_173','',0),(17,16,173,0,'95.20.28.124',1355755050,1,1,1,1,'Re: vendo garmin edge 305','no lo cambio , lo vendo','',0,0,'','1kasaz5d',0,0,'u_101','',0);
